import p4img from './pro4.jpeg';
let data_product=[    {
        id:1,
        nam:"Red Suit",
        image:p1img,
        new_price:1500,
        old_price:2000,
    },
    {
        id:2,
        nam:"Pink Suit",
        image:p2img,
        new_price: 1000,
        old_price: 3000,
    },
    {
        id:3,
        nam:"White Suit",
        image:p3img,
        new_price: 2000,
        old_price:2500,
    },
    {
        id:4,
        nam:"Greeen Suit",
        image:p4img,
        new_price:2300,
        old_price:3000,
    }
]
export default data_product;
